import React from 'react'

const SideMenu = props => {
  return (
    <ul class="list-group">
      <li class="list-group-item active">جميع المواد</li>
      <li class="list-group-item">المادة ١</li>
      <li class="list-group-item">المادة ٢</li>
      <li class="list-group-item">المادة ٣</li>
      <li class="list-group-item">المادة ٤</li>
    </ul>
  )
}

export default SideMenu
